import React from "react";
import { useParams } from "react-router-dom";
import { artist_information } from "./Artists";


function ArtistsPage() {
    let { artistId } = useParams();
    const artist = artist_information.find(artist => artist.id === parseInt(artistId));
    console.log(artist.ArtistName);

    // const artist = { id: artistId, name: "Artist Name", genre: "Genre" };
    return (
        <>
            <div class ="row m-2 p-5">
            <h1 class = "col-xl-7 text-start">{artist.name}</h1>
            <h1 class = "col-xl-3 text-end " >#{artist.popularity}</h1>
            <h3 class = "col-xl-3 text-start">{artist.genre}</h3>
            <div></div>
            <p class = "col-xl-3 text-start">Personal information : Birthdate : {artist.birth} Country : {artist.country}</p>

            </div>
            <div class ="row m-2 p-5">
                <h1 class = "col-xl-6 text-start">Pass Events</h1>
                <div></div>
                {
                    artist.albums.map((albums) => (
                        <div class="card bg-secondary text-white">
                        <img class="card-img-top" src="./public/logo192.png" alt="artists photo" />
                        <div class="card-header">
                            <Link to={`/artists/artistspage/${props.id}`}>{props.ArtistsName}</Link>
                        </div>
                        <div class="card-header">{props.Genre}</div>
                        <div class="card-body p-5">{props.VenueList}</div>

                    </div>
                    ))
                }
            </div>


        </>
    );
}

export default ArtistsPage;
